function App() {
  const [user, setUser] = useState('Coucou');
  useEffect(() => {
    setUser('Non')
  }, []);
  return (
    <div className="App">
      <header className="App-header">
        <h1>{user}</h1>
      </header>
    </div>
  );
}

export default App;
